import React, { useState } from 'react';
import { registerRestaurant } from '.';  // Import the API call

function RestaurantRegistration() {
  const [formData, setFormData] = useState({
    restaurantName: '',
    ownerName: '',
    email: '',
    phone: '',
    password: '',
    address: '',
    deliveryRadius: '',
    businessHours: '',
    menuItems: [
      { name: '', price: '', category: '', description: '', image: null },
      { name: '', price: '', category: '', description: '', image: null }
    ],
    restaurantDescription: '',
    logo: null,
    foodLicense: null,
    healthCertification: null,
    accountNumber: '',
    routingNumber: ''
  });

  const [menuImages, setMenuImages] = useState([]);

  const handleChange = (e) => {
    const { name, value, type, files } = e.target;

    if (type === 'file') {
      setFormData((prevData) => ({
        ...prevData,
        [name]: files[0]
      }));
    } else {
      setFormData((prevData) => ({
        ...prevData,
        [name]: value
      }));
    }
  };

  const handleMenuItemChange = (index, e) => {
    const { name, value, type, files } = e.target;
    const updatedMenuItems = [...formData.menuItems];

    if (type === 'file') {
      updatedMenuItems[index][name] = files[0];
    } else {
      updatedMenuItems[index][name] = value;
    }

    setFormData((prevData) => ({
      ...prevData,
      menuItems: updatedMenuItems
    }));
  };

  const handleMenuImagesChange = (e) => {
    setMenuImages(e.target.files);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const submissionData = new FormData();
    
    // Append form data
    Object.keys(formData).forEach((key) => {
      if (key === 'menuItems') {
        formData.menuItems.forEach((item, index) => {
          Object.keys(item).forEach((itemKey) => {
            submissionData.append(`menuItems[${index}][${itemKey}]`, item[itemKey]);
          });
        });
      } else if (formData[key] instanceof File) {
        submissionData.append(key, formData[key]);
      } else {
        submissionData.append(key, formData[key]);
      }
    });

    // Append multiple menu images
    Array.from(menuImages).forEach((image, index) => {
      submissionData.append(`menuImages[${index}]`, image);
    });

    try {
      // Use the API call from api/index.js
      const response = await registerRestaurant(submissionData);

      if (response.status === 200) {
        console.log('Restaurant registered successfully!');
      } else {
        console.log('Error registering restaurant');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div>
      <h1>Register Your Restaurant</h1>
      <form onSubmit={handleSubmit} encType="multipart/form-data">
        {/* Basic Information */}
        <h2>Basic Information</h2>
        <label>Restaurant Name:</label>
        <input type="text" name="restaurantName" value={formData.restaurantName} onChange={handleChange} required /><br />

        <label>Owner's Name:</label>
        <input type="text" name="ownerName" value={formData.ownerName} onChange={handleChange} required /><br />

        <label>Email Address:</label>
        <input type="email" name="email" value={formData.email} onChange={handleChange} required /><br />

        <label>Phone Number:</label>
        <input type="tel" name="phone" value={formData.phone} onChange={handleChange} required /><br />

        <label>Password:</label>
        <input type="password" name="password" value={formData.password} onChange={handleChange} required /><br />

        {/* Location and Address */}
        <h2>Location and Address</h2>
        <label>Physical Address:</label>
        <textarea name="address" value={formData.address} onChange={handleChange} required></textarea><br />

        <label>Delivery Radius (km):</label>
        <input type="number" name="deliveryRadius" value={formData.deliveryRadius} onChange={handleChange} required /><br />

        {/* Operating Hours */}
        <h2>Operating Hours</h2>
        <label>Business Hours:</label>
        <input type="text" name="businessHours" value={formData.businessHours} onChange={handleChange} required /><br />

        {/* Menu Information */}
        <h2>Menu Information</h2>
        {formData.menuItems.map((item, index) => (
          <div key={index} className="menuItem">
            <label>Item Name:</label>
            <input type="text" name="name" value={item.name} onChange={(e) => handleMenuItemChange(index, e)} required /><br />

            <label>Price:</label>
            <input type="number" name="price" value={item.price} onChange={(e) => handleMenuItemChange(index, e)} required /><br />

            <label>Category:</label>
            <input type="text" name="category" value={item.category} onChange={(e) => handleMenuItemChange(index, e)} required /><br />

            <label>Description:</label>
            <textarea name="description" value={item.description} onChange={(e) => handleMenuItemChange(index, e)} required></textarea><br />

            <label>Upload Image:</label>
            <input type="file" name="image" onChange={(e) => handleMenuItemChange(index, e)} required /><br />
          </div>
        ))}

        <label>Upload Menu Photos:</label>
        <input type="file" name="menuImages" multiple onChange={handleMenuImagesChange} /><br />

        {/* Branding */}
        <h2>Branding</h2>
        <label>Restaurant Description:</label>
        <textarea name="restaurantDescription" value={formData.restaurantDescription} onChange={handleChange}></textarea><br />

        <label>Upload Logo:</label>
        <input type="file" name="logo" onChange={handleChange} required /><br />

        {/* Licenses and Certifications */}
        <h2>Licenses and Certifications</h2>
        <label>Food Business License:</label>
        <input type="file" name="foodLicense" onChange={handleChange} required /><br />

        <label>Health and Safety Certification:</label>
        <input type="file" name="healthCertification" onChange={handleChange} /><br />

        {/* Payment Information */}
        <h2>Payment Information</h2>
        <label>Bank Account Number:</label>
